(self.webpackChunkbugu=self.webpackChunkbugu||[]).push([[6503],{7540:(t,e,o)=>{"use strict";o.r(e),o.d(e,{data:()=>i});const i={key:"v-4746ece5",path:"/Git/Git%E6%92%A4%E9%94%80%E5%AF%B9%E8%BF%9C%E7%A8%8B%E4%BB%93%E5%BA%93%E7%9A%84push&commit%E6%8F%90%E4%BA%A4.html",title:"Git撤销对远程仓库的push&commit提交",lang:"zh-CN",frontmatter:{},excerpt:"",headers:[{level:2,title:"撤销push",slug:"撤销push",children:[]},{level:2,title:"撤销commit",slug:"撤销commit",children:[]}],filePathRelative:"Git/Git撤销对远程仓库的push&commit提交.md",git:{updatedTime:1600936009e3}}},3552:(t,e,o)=>{"use strict";o.r(e),o.d(e,{default:()=>c});const i=(0,o(6252).uE)('<h1 id="git撤销对远程仓库的push-commit提交"><a class="header-anchor" href="#git撤销对远程仓库的push-commit提交">#</a> Git撤销对远程仓库的push&amp;commit提交</h1><h2 id="撤销push"><a class="header-anchor" href="#撤销push">#</a> 撤销push</h2><ol><li>执行 <code>git log</code>查看日志，获取需要回退的版本号</li></ol><p><img src="https://img2018.cnblogs.com/blog/788599/201809/788599-20180927164303193-2084393469.png" alt="img"></p><ol start="2"><li>执行 <code>git reset –-soft &lt;版本号&gt;</code> ，如 <code>git reset --soft 4f5e9a90edeadcc45d85f43bd861a837fa7ce4c7</code> ，重置至指定版本的提交，达到撤销提交的目的</li></ol><p>然后执行 git log 查看 <img src="https://img2018.cnblogs.com/blog/788599/201809/788599-20180927164827547-451137005.png" alt="img"></p><p>此时，已重置至指定版本的提交，log中已经没有了需要撤销的提交</p><blockquote><p><code>git reset</code> 命令分为两种： <code>git reset –-soft</code> 与 <code>git reset –-hard</code> ，区别是：</p><p>前者表示只是改变了HEAD的指向，本地代码不会变化，我们使用<code>git status</code>依然可以看到，同时也可以<code>git commit</code>提交。后者直接回改变本地源码，不仅仅指向变化了，代码也回到了那个版本时的代码。</p></blockquote><ol start="3"><li>执行 <code>git push origin 分支名 –-force</code> ，强制提交当前版本号。</li></ol><p>至此，撤销push提交完成。</p><h2 id="撤销commit"><a class="header-anchor" href="#撤销commit">#</a> 撤销commit</h2><ol><li><p>执行 <code>git log</code> 查看需要撤销的commit的前面一个提交版本的id；</p></li><li><p>执行 <code>git reset --hard commit_id</code> ，该commit_id为需要撤销的commit的提交的前面一个提交的版本，即需要恢复到的提交的id，重置至指定版本的提交，达到撤销提交的目的</p></li><li><p>执行 <code>git log</code> 查看，commit提交已撤销</p></li></ol><p>文章来源：https://www.cnblogs.com/chaoxiZ/p/9714085.html</p>',13),c={render:function(t,e){return i}}}}]);